(35, 'Dars-e-Nizami', '<style type="text/css">.tablestyle {\r\n  font-family: "Trebuchet MS", Arial, Helvetica, sans-serif;\r\n  border-collapse: collapse;\r\n  width: 100%;\r\n}\r\n\r\n.tablestyle td, .tablestyle th {\r\n  border: 1px solid #ddd;\r\n  padding: 8px;\r\n}\r\n\r\n.tablestyle tr:nth-child(even){background-color: #f2f2f2;}\r\n\r\n.tablestyle tr:hover {background-color: #ddd;}\r\n\r\n\r\n.tablestyle th:nth-child(1){\r\n  background-color: #0066c1;\r\n}\r\n.tablestyle th {\r\n  padding-top: 12px;\r\n  padding-bottom: 12px;\r\n  text-align: left;\r\n  color: white;\r\n  font-size: 18px;\r\n}\r\n</style>\r\n<p>This is a six years degree course equivalent to Masters Degree of Islamiat &amp; Arabic, which comprises of complete translation and interpretation of Qur&rsquo;an.</p>\r\n\r\n<p><strong>Sihaie-Sit&rsquo;ta</strong> (Authentic Hadith books) are included in syllabus in the final year. Detailed topics are taught in Fiqh and Asool-e-Fiqh.</p>\r\n\r\n<p>Students are also trained in Arabic grammar and the rules governing pronunciation known as Tajweed for recitation of the Qur&rsquo;an.</p>\r\n\r\n<p>Following subjects are offered in Dars-e-Nizami six years course:</p>\r\n\r\n<div class="row mb-30">\r\n<div class="col-md-6">\r\n<table class="tablestyle">\r\n	<thead>\r\n		<tr>\r\n			<th>Khasa I &ndash; 1st Year</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Subject</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Tarjma Tafseer-ul-Quran</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Zaad-ul-Talibeen + Jawami-ul-qalim</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Taleem-ul-Islam + Tareekh-e-Islam</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ilm-un-Nahav + awamil-un-nahaw</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ilm-us-Sarf Part 1,2,3</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tariqat-ul-Asriya (Part 1) + Arbi Ka Mualim (Part 1,2)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div class="col-md-6">\r\n<table class="tablestyle">\r\n	<thead>\r\n		<tr>\r\n			<th>Khasa II &ndash; 2nd Year</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Subject</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Tarjma Tafseer-ul-Quran</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ilm-us-Seegha+ Khasiyat-ul-Abwab</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Qudoori</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Asool-u-Shashi + Asan Asool-e-Fiqh</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Hadayat-un-Nahav</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Mantiq + Sharah Miyaata Aamil</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<div class="row mb-30">\r\n<div class="col-md-6">\r\n<table class="tablestyle">\r\n	<thead>\r\n		<tr>\r\n			<th>Alia I &ndash; 3rd Year</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Subject</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Tarjma Tafseer-ul-Quran</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ryaz-us-Sualiheen</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Qudoori</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Noor-ul-Anwar + Siraji</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Duroos-ul-Balagah</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Mukhtarat + Aqqedah-tu-Tahaviyah</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div class="col-md-6">\r\n<table class="tablestyle">\r\n	<thead>\r\n		<tr>\r\n			<th>Alia II &ndash; 4th Year</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Subject</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Tarjma Tafseer-ul-Quran</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Mishkaat-ul-Masabih (Part 1)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Mishkaat-ul-Masabih (Part 2)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Al-Hidaya (Part 1)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tarbiyat-e-Aulad</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Shrah Aqaid+ Aloom-ul-Quran</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<div class="row mb-30">\r\n<div class="col-md-6">\r\n<table class="tablestyle">\r\n	<thead>\r\n		<tr>\r\n			<th>Aalmia I &ndash; 5th Year</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Subject</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Tafseer Al-Jalalain</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tayseer Mustalah-al-Hadees</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Al-Hidaya (Part 2)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ma&rsquo;ani-ul-Asaar</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Jame-ut-Tirmizi (Part 2)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sunan Abu Dawood (Part 1)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div class="col-md-6">\r\n<table class="tablestyle">\r\n	<thead>\r\n		<tr>\r\n			<th>Aalmia II &ndash; 6th Year</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Subject</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Sahih al Bukhari (Part 1)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sahih al Bukhari (Part 2)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Al-Sahih Li Muslim (Part 1)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Al-Sahih Li Muslim (Part 2)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Jame-ut-Tirmizi (Part 1)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sunan Abu Dawood (Part 2)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>', 'Dars-i Nizami. Dars-i Nizami is a study curriculum or system used in traditional Islamic institutions (madrassas) and Dar Ul Ulooms, which originated in the Indian subcontinent in the 18th century and can now also be found in parts of South Africa, Canada, the United States, the Caribbean and the UK.\r\n', 'SocialMediaPostMaker_02092019_112440.png', '2018-11-26 07:37:39', '2019-09-10 03:24:42', 1, 1, 'dars-e-nizami', '6 Years', '01 Jan 2019', 'Alima Teachers', '<p>Classes Schedule is given as below:</p>\r\n\r\n<blockquote>\r\n<p>&nbsp;</p>\r\n\r\n<table class="table table-bordered">\r\n	<tbody>\r\n		<tr>\r\n			<td>Monday</td>\r\n			<td>08:00 AM - 02:00 PM</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tuesday</td>\r\n			<td>08:00 AM - 02:00 PM</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Wednesday</td>\r\n			<td>08:00 AM - 02:00 PM</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Thursday</td>\r\n			<td>08:00 AM - 02:00 PM</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Friday</td>\r\n			<td>08:00 AM - 02:00 PM</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Saturday</td>\r\n			<td>08:00 AM - 02:00 PM</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</blockquote>\r\n', '<p>Few of following books will be taught throughout this course:</p>\r\n\r\n<blockquote>Mutafarriq&nbsp;<br />\r\nMantiq o Falsafa(Takmeel)<br />\r\nAl Aula (1st Year)<br />\r\nAl Sania (2nd Year)&nbsp;</blockquote>\r\n\r\n<p><a class="button medium" href="http://azzuhaa.shabair.com/uploads/Writing%20Book008%20(1)%208%20aug.pdf">Download File</a></p>\r\n'),
(36, 'Darasaat-e-Deenia', '<style type="text/css">.tablestyle {\r\n  font-family: "Trebuchet MS", Arial, Helvetica, sans-serif;\r\n  border-collapse: collapse;\r\n  width: 100%;\r\n}\r\n\r\n.tablestyle td, .tablestyle th {\r\n  border: 1px solid #ddd;\r\n  padding: 8px;\r\n}\r\n\r\n.tablestyle tr:nth-child(even){background-color: #f2f2f2;}\r\n\r\n.tablestyle tr:hover {background-color: #ddd;}\r\n\r\n\r\n.tablestyle th:nth-child(1){\r\n  background-color: #0066c1;\r\n}\r\n.tablestyle th {\r\n  padding-top: 12px;\r\n  padding-bottom: 12px;\r\n  text-align: left;\r\n  color: white;\r\n  font-size: 18px;\r\n}\r\n</style>\r\n<p>This is a two years course. Following areas are covered in Darasaat-e-Deenia (Faazila Course):</p>\r\n\r\n<div class="row mb-30">\r\n<div class="col-md-6">\r\n<table class="tablestyle">\r\n	<thead>\r\n		<tr>\r\n			<th>1st Year</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Subject</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Tajweed (Hifz last part 30th Para + Complete Oral 30th Para)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tarjama Tafseer-ul-Quran</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ma&rsquo;arif-al-Hadees (Vol: 2,3,4)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Baheshti Zevar (Part: 2,3,4) + Taleem-ul-Islam</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ilm-un-Nahv + Ilm-us-Sarf (Part: 1,2)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tareeka-tul-Asria (Vol:1) + Qasas-un-Nabiyeen (Vol: 1,2)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Seerat Khaatam-al-Anbia</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div class="col-md-6">\r\n<table class="tablestyle">\r\n	<thead>\r\n		<tr>\r\n			<th>2nd Year</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Subject</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Tarjama Tafseer-ul-Quran</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ma&rsquo;arif-al-Hadees (Vol: 1,5,6,7)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Baheshti Zevar (Part: 5,6,7)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Awamil-un-Nahv + Ilm-us-Sarf (Part: 3,4)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tareeka-tul-Asria (Vol:2) + Qasas-un-Nabiyeen (Vol:3,4)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Hayaat-ul-Muslimeen</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<div class="row mb-30">\r\n<div class="col-md-6">&nbsp;</div>\r\n\r\n<div class="col-md-6">&nbsp;</div>\r\n</div>\r\n\r\n<div class="row mb-30">&nbsp;</div>', 'Azzuha Islamic Institute is offering a 2 years comprehensive course of Dirasat-e-Deenia based on the curriculum of Wifaq-ul-Madaris, which emphasis on translation and tafseer of the entire Quran, elements from Hadith,Islamic jurisprudence, Arabic morphology and Tajweed.', 'darsat e deenia.png', '2019-04-20 18:33:16', '2020-03-12 16:43:10', 1, 1, 'darasaat-e-deenia', '2 Years', '15th Shawal', 'Alima Teachers', '', '');
