INSERT INTO `course` (`id`, `title`, `thumbnail`, `content`, `excerpt`, `created`, `last_update`, `published`, `active`, `slug`) VALUES
(17, 'Summer Camp', 'summer.jpg', '<p>It&#39;s a short and amazing course for summer vacations for three age groups(KIds, youngsters and ladies). the purpose of the course is to inculcate the <strong>moral&nbsp;</strong>and<strong> ethical </strong>values to make them true Muslims.</p>\r\n\r\n<p>this year this course starts in summer vacations, the month will be mentioned after the current&nbsp;pandemic situation.&nbsp;</p>', 'It''s a short and amazing course for summer vacations for three age groups(KIds, youngsters and ladies). the purpose of the course is to inculcate the morals and ethical values to make them true Muslims.', '2018-07-18 10:41:42', '2020-04-05 18:54:02', 1, 1, 'summer-camp'),
(20, 'Dora-e-Tafseer-ul-Quran', 'images (1).jpg', '<p>This is an ongoing course which includes word-to-word translation and interpretation of the Quran. It is specific for the month of Ramadan to follow the Sunnah of our Holy prophet as he did in his life.</p>', 'This is an ongoing course which includes word-to-word translation and interpretation of the Quran. It is specific for the month of Ramadan to follow the Sunnah of our Holy prophet as he did in his life.', '2018-07-18 16:15:17', '2020-04-05 18:37:22', 1, 1, 'dora-e-tafseer-ul-quran'),
(21, 'Sibghat-Allah Course', '5497fea8-75d1-4a2e-8115-150e74984ff4.jpg', '<p>The best colour is the colour of Allah<br />\r\n&nbsp;<br />\r\nThe best religion is the religion of &nbsp;Islam</p>\r\n\r\n<p>This a short course for two months and will be started in February. Its classes will be twice a week. It will introduce the &quot;Quran&quot; and &quot;Seerah of Sahabiaat&quot;</p>', 'Best colour is the colour of Allah\r\n \r\nBest religion is the religion of  Islam\r\n\r\nThis a short course for two months and will be started in February. Its classes will be twice a week. It will introduce the "Quran" and "Seerah of Sahabiaat"', '2018-08-05 07:50:09', '2020-04-05 18:57:06', 1, 1, 'sibghat-allah-course'),
(22, 'Treasure of Quran', 'al-quran-mp3.jpg', '<p><strong><em>Quran is the book of Guidance&nbsp;</em></strong></p>\r\n\r\n<p>This is a course of one-year duration. It comprises the complete introduction of all surahs of Quran and will teach how we can change our lives in the light of Quran.</p>', 'Quran is the book of Guidance \r\n\r\nThis is a course of one-year duration. It comprises the complete introduction of all surahs of the Quran and will teach how we can change our lives in the light of Quran.', '2018-08-05 07:50:50', '2020-04-05 19:01:08', 1, 1, 'treasure-of-quran');
