(17, 'About Us', '<!--=================================\r\n About-->\r\n    <section class="page-section-ptb">\r\n      <div class="container">\r\n        <div class="row">\r\n          <div class="col-lg-6">\r\n            <div class="who-we-are-left">\r\n              <div class="owl-carousel" data-nav-dots="true" data-items="1" data-md-items="1" data-sm-items="1" data-xs-items="1" data-xx-items="1">\r\n                <div class="item">\r\n                  <img class="img-fluid full-width" src="http://azzuhaa.org/uploads/zzzzzzzzzzzzzzzzzzz_thumb.jpg" alt="">\r\n                </div>\r\n                <div class="item">\r\n                  <img class="img-fluid full-width" src="http://azzuhaa.org/uploads/images%20(1).jpg" alt="">\r\n                </div>\r\n                <div class="item">\r\n                  <img class="img-fluid full-width" src="http://azzuhaa.org/uploads/zzzzzzzzzzzzzzzzzzz_thumb.jpg" alt="">\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <div class="col-lg-6 sm-mt-30">\r\n            <div class="section-title">\r\n              <h6><span style="color: inherit; font-family: inherit;">Who we are and what we do</span></h6>\r\n              <h2>Get to know us better.</h2>\r\n              <p>Azzuha is self assisting, non sectarian Islamic Institute devoted to provide core understanding of Islamic scriptures.  Azzuha Islamic Institute is diligently playing its role to connect people with teaching of Quran to help them become the true followers of the Prophet ???? ???? ?.  Women play a fundamental role in the teaching and training of Ummah. Therefore, it is extremely important that a women herself should be well versed of the basic principles of Deen in order to produce children who are engrossed with Islamic intellect.&nbsp;</p></div>\r\n            <div class="row mt-30">\r\n              <div class="col-md-6">\r\n                <ul class="list list-unstyled list-hand">\r\n                  <li>Award-winning design</li>\r\n                  <li>Super Fast Customer support</li>\r\n                </ul>\r\n              </div>\r\n              <div class="col-md-6">\r\n                <ul class="list list-unstyled list-hand">\r\n                  <li>Easy to Customize pages</li>\r\n                  <li>Powerful Performance</li>\r\n                </ul>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class="row">\r\n          <div class="col-lg-4 col-md-4 col-sm-4">\r\n            <div class="feature-text left-icon mt-50 xs-mt-20">\r\n              <div class="feature-icon"> <span class="ti-desktop theme-color" aria-hidden="true"></span>\r\n              </div>\r\n              <div class="feature-info">\r\n                <h5 class="text-back">Our Institute</h5>\r\n                <p>Az.Zuhaa Islamic Institute is playing an important role In the society for imparting the knowledge of Quran and Hadith in this time and era.</p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <div class="col-lg-4 col-md-4 col-sm-4">\r\n            <div class="feature-text left-icon mt-50 xs-mt-20">\r\n              <div class="feature-icon"> <span class="ti-server theme-color" aria-hidden="true"></span>\r\n              </div>\r\n              <div class="feature-info">\r\n                <h5 class="text-back">Our Mission</h5>\r\n                <p>Our mission is to provide a learning environment to Women, where they can Enlighten themselves by the knowledge of the Quran and Sunnah&nbsp; &nbsp;</p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n          <div class="col-lg-4 col-md-4 col-sm-4">\r\n            <div class="feature-text left-icon mt-50 xs-mt-20">\r\n              <div class="feature-icon"> <span class="ti-heart theme-color" aria-hidden="true"></span>\r\n              </div>\r\n              <div class="feature-info">\r\n                <h5 class="text-back">We Love</h5>\r\n                <p>We love to provide an unbiased atmosphere to educate Aalimat, Haafizaat, Naashiraat and Daiayat with the best, practical, social, moral, spiritual and Intellectual education, who can then enlighten this world.</p>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </section>\r\n    <!--=================================\r\n About-->\r\n    <!--=================================\r\ntestimonial-->\r\n    <section class="page-section-ptb bg-overlay-black-80 parallax" style="background-image:url(http://localhost/finalazz//assets/images/bg/05.jpg);">\r\n      <div class="container">\r\n        <div class="row justify-content-center">\r\n          <div class="col-md-10">\r\n            <div class="owl-carousel" data-nav-dots="true" data-items="1" data-md-items="1" data-sm-items="1">\r\n              <div class="item">\r\n                <div class="testimonial text-white clean">\r\n                  <div class="testimonial-avatar">\r\n                    <img alt="" src="http://localhost/finalazz//assets/images/team/01.jpg">\r\n                  </div>\r\n                  <div class="testimonial-info">Excellent Customer support! These guys reply within minutes sometimes and really help you with when you need them. The template itself is very extended as well. Happy with my purchase!</div>\r\n                  <div class="author-info"> <strong>15Twelve - <span>ThemeForest user</span></strong> \r\n                  </div>\r\n                </div>\r\n              </div>\r\n              <div class="item">\r\n                <div class="testimonial text-white clean">\r\n                  <div class="testimonial-avatar">\r\n                    <img alt="" src="http://localhost/finalazz//assets/images/team/02.jpg">\r\n                  </div>\r\n                  <div class="testimonial-info">One of the most complete template here. Thanks a lot for such great features, pages, shortcodes and home variations. Incredible Job. And the best of all, great introductions</div>\r\n                  <div class="author-info"> <strong>Xerracol - <span>ThemeForest user</span></strong> \r\n                  </div>\r\n                </div>\r\n              </div>\r\n              <div class="item">\r\n                <div class="testimonial text-white clean">\r\n                  <div class="testimonial-avatar">\r\n                    <img alt="" src="http://localhost/finalazz//assets/images/team/03.jpg">\r\n                  </div>\r\n                  <div class="testimonial-info">This is a well put together template and the developer offers great support. I''ve been in contact with them and the response was prompt and everything has been taken care of.</div>\r\n                  <div class="author-info"> <strong>Warble - <span>ThemeForest user</span></strong> \r\n                  </div>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </section>\r\n    <!--=================================\r\ntestimonial-->\r\n    <!--=================================\r\n Our History -->\r\n    <section class="our-history white-bg page-section-ptb">\r\n      <div class="container">\r\n        <div class="row justify-content-center">\r\n          <div class="col-lg-10">\r\n            <div class="section-title text-center">\r\n              <h6>From the beginning</h6>\r\n              <h2 class="title-effect">Our History</h2><p style="text-align: justify; ">Azzuha Islamic Institute was founded in 2009 by Ustadha Beena Nadir Sahiba who was chosen\r\nfor the sacred cause due to her virtuous and noble nature. She belongs to an educated and\r\nreligiously oriented family and her father has also devoted his life to spread the knowledge of\r\nIslam. The institute started working with minimal resources and in a short period of time it\r\nestablished its second campus. With the grace of ???? ??????????? ??????????? and in the light of the\r\nguiding principle of the Prophet ???? ???? ? and with the consistent efforts of the\r\nprincipal and her motivated team, ????????? ???????? Azzuhaa Islamic Institute has established two\r\ncampuses in Lahore? The word Az-Zuhaa is a true epitomizer of the aim and objectives of the\r\ninstitute which reflects “spreading peace with the light of Islam”. The founder of the institute\r\nputs her earnest efforts to help the institute gain its recognition as a true messenger of Islam\r\nnationally and internationally under the supervision of Islamic scholars.</p>\r\n              <p style="text-align: justify;"><br></p></div></div></div>\r\n      </div>\r\n    </section>\r\n    <!--=================================\r\n Our History -->', '', 'no-template', '2018-06-04 07:37:21', '2020-04-25 22:09:09', 1, 1, 'about-us', '', ''),
