(16, 'Dua-e-Takmeel-e-Quran 2019', 'dua_takmeel_e_quran.png', '<p>Special Grand Dua-e-Takmeel-e-Quran by #Aalimaa Beena Nadir Sahiba</p>', 'Special Grand Dua e Takmeel e Quran By # Aalimaa Beena Nadir Sahiba', '2019-10-26 07:59:47', 13, '2019-10-26 18:04:13', 1, 1, 'dua-e-takmeel-e-quran-2019', 'y_37u9J0JPo'),
